import React, { Component } from "react";
import Counter from "./counter";
class Counters extends Component {
  state = {
    counters: [
      { id: 1, value: 1 },
      { id: 2, value: 2 },
      { id: 3, value: 1 },
      { id: 4, value: 2 },
    ],
  };
  render() {
    return (
      <React.Fragment>
        {this.state.counters.map((temp) => (
          <Counter key={temp.id} value={temp.value}>
            <h4>Counter #{temp.id}</h4>
          </Counter>
        ))}
      </React.Fragment>
    );
  }
}

export default Counters;
